import React from 'react';
import { navigate } from 'react-router-dom';

const Home = ({ navigate, token }) => {
    return (
        <div className='home'>
            <div className='homePostsButtonCon'>
                <div className='postsButtonContainer'>
                    <button className='postsButton' onClick={() => navigate('/posts')} />
                </div>
            </div>
            <div className='homePostsButtonCon'>
                {
                    token ? (
                        <>
                        <h3 className='homePostHeader'>See all postings!</h3>
                            <div className='profileButtonContainer'>
                                <button className='profileButton' onClick={() => navigate('/profile')} />
                            </div>
                            <div className='addButtonContainer'>
                                <button className='addButton' onClick={() => navigate('/posts/create-post')} />
                            </div>
                        </>
                    ) : (
                        <p></p>
                    )
                }
            </div>
        </div>
    )
}

export default Home;
